处的环境，而不是由我的所谓本性决定的。其实在当时我就已经察觉到，工作中的处境正在一点点地改变我，令我变得更急躁、易怒，更没有责任心，总之做不到原本我对自己的要求，而且也不想做到了。这些改变有时会让我觉得痛快，我痛快的时候就不太能感觉到烦躁和不满。比如有次我骂了一个不认识的妇女——我很少骂人，因此印象特别深刻。logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1625,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1625,logseq____&quot;^Flogseq____&quot;,1624,536871067]],[logseq____&quot;^15logseq____&quot;,[1625,logseq____&quot;^Xlogseq____&quot;,1427,536871067]],[logseq____&quot;^15logseq____&quot;,[1625,logseq____&quot;^Vlogseq____&quot;,1427,536871067]],[logseq____&quot;^15logseq____&quot;,[1625,logseq____&quot;^Ulogseq____&quot;,1427,536871067]],[logseq____&quot;^15logseq____&quot;,[1625,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66a90682-1f74-4fa2-99e6-5b7a61191b14logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^Flogseq____&quot;,1625,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^Xlogseq____&quot;,1427,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^Vlogseq____&quot;,1427,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^Ulogseq____&quot;,1427,536871067]],[logseq____&quot;^15logseq____&quot;,[1626,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66a90682-efe8-4464-b3ac-18e7c3c50043logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1627,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1627,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871067]],[logseq____&quot;^15logseq____&quot;,[1627,logseq____&quot;^Flogseq____&quot;,1626,536871067]],[logseq____&quo       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
